def get_legacy_futures_only(commodity_name=None, limit=100, start_date=None, end_date=None):
    """Get Legacy COT futures-only data"""
    import requests

    base_url = 'https://publicreporting.cftc.gov/resource/6dca-aqww.json'
    params = {
        '$limit': limit,
        '$order': 'report_date_as_yyyy_mm_dd DESC'
    }

    # Build where clause
    where_clauses = []
    if commodity_name:
        where_clauses.append(f"commodity_name='{commodity_name}'")
    if start_date:
        where_clauses.append(f"report_date_as_yyyy_mm_dd >= '{start_date}'")
    if end_date:
        where_clauses.append(f"report_date_as_yyyy_mm_dd <= '{end_date}'")

    if where_clauses:
        params['$where'] = ' AND '.join(where_clauses)

    response = requests.get(base_url, params=params)
    response.raise_for_status()
    return response.json()

