def get_disaggregated_futures_only(commodity_name=None, limit=100):
    """Get Disaggregated COT futures-only data with detailed trader breakdown"""
    import requests

    base_url = 'https://publicreporting.cftc.gov/resource/72hh-3qpy.json'
    params = {
        '$limit': limit,
        '$order': 'report_date_as_yyyy_mm_dd DESC'
    }

    if commodity_name:
        params['$where'] = f"commodity_name LIKE '%{commodity_name}%'"

    response = requests.get(base_url, params=params)
    response.raise_for_status()

    # Calculate net positions for each trader category
    data = response.json()
    for record in data:
        if 'prod_merc_positions_long' in record:
            record['producer_net'] = int(record.get('prod_merc_positions_long', 0)) - int(record.get('prod_merc_positions_short', 0))
        if 'swap_positions_long_all' in record:
            record['swap_dealer_net'] = int(record.get('swap_positions_long_all', 0)) - int(record.get('swap__positions_short_all', 0))
        if 'm_money_positions_long_all' in record:
            record['managed_money_net'] = int(record.get('m_money_positions_long_all', 0)) - int(record.get('m_money_positions_short_all', 0))

    return data

